                    <a href="localhost:3000/login">Login</a><a href="localhost:3000/signup">Sign up</a>
                </div>
            }

    <style jsx>{`
        .main {
            display: flex;
            flex-direction: column;
            justify-content: center;
            height: 3rem;
            background: #2C404D;
        }

        .account {
            align-self: flex-end;
            display: flex;
            width: 20%;
            justify-content: space-around;
        }
    `}</style>
    </div>
